export const CLIENT_ID = "146f5ca7d8cd4081ba4db2c32adda19f";
export const SPOTIFY_AUTHORIZE_ENDPOINT = "https://accounts.spotify.com/authorize";
export const REDIRECT_URL = "http://localhost:3000/webapp";

export const SCOPES = [
    "user-read-currently-playing",
    "user-read-playback-state",
    "playlist-modify-public",
    "playlist-modify-private"
];
export const SCOPES_URL_PARAM = SCOPES.join("%20");
